import React from 'react';
import "./news_partners.scss"
const PartnerNews = () => {
    return (
        <div className="news_part">
            <div className="news_part_img">
                <div className="news_part_img1">
                    <img src="https://via.placeholder.com/511x247"/>
                </div>
            </div>
            <div className="title_news">
                <img src="https://via.placeholder.com/105x58"/>
                <div className="partner">
                    <div className="partner_name">Alphard Group
                    </div>
                    <div className="partner_desc">Генеральный партнер
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PartnerNews;
